//@ts-nocheck
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import CheckIcon from '@material-ui/icons/Check';
import React from 'react';
import {StyleSheet, Text} from 'react-native';


const styles = {

  ContentStyles:{

  },
  paper: {
    padding: 10,
    textAlign: 'center',
    color: '#000',
  }
}

type cardprops={
  children?: React.ReactNode
  cardData?: any
  ContentHeaderStyles?:any
  ContentTitleStyles?:any
  ContentDescriptionStyles?:any
  ContentIconStyles?:any
}

export const CardDisplayV = (props:cardprops) => {
  const _getCards = () => {

    const _tempData:any = [];
  // eslint-disable-next-line no-unused-expressions
    Array.isArray(props?.cardData) && props?.cardData.forEach(item=>{
      _tempData.push(
        <Grid item xs={12} sm={6} md={3}>
          <Paper style={StyleSheet.flatten(styles.paper)}>
            {/* {
              item?.icon ? <img style={StyleSheet.flatten([styles.ContentStyles, props?.ContentIconStyles])} src={item.icon}/> : null
            } */}
            <Text>{item.planName}</Text>
            <hr/>

             <ul>

               <li><span> <CheckIcon/></span>{item.services1}</li>
               <li><span> <CheckIcon/></span>{item.services2}</li>
               <li>{item.services2}</li>
               <li>{item.services3}</li>
               <li>{item.services4}</li>
               <li>{item.services5}</li>
               <li>{item.services6}</li>
               <li>{item.services7}</li>
             </ul>
            <Text>{item.amount}</Text>
             <br/>
             <button>Chooseplan</button>

             {/* <Text style={StyleSheet.flatten([styles.ContentStyles, props?.ContentHeaderStyles])}>{item?.header}</Text>
             <Text style={StyleSheet.flatten([styles.ContentStyles, props?.ContentTitleStyles])}>{item?.title}</Text>
             <Text style={StyleSheet.flatten([styles.ContentStyles, props?.ContentDescriptionStyles])}>{item?.description}</Text> */}
           </Paper>
        </Grid>
      )
    });
    return _tempData;
  }

  return(
    <Grid container justify={"center"} alignItems={"center"} >
      <Grid item xs={11}>
      <Grid container justify={"center"} alignItems={"center"} spacing={4}>
      {_getCards()}
      </Grid>
      </Grid>
    </Grid>
  )
}
